// src/pages/instructor/InstructorDashboard.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const InstructorDashboard = () => {
  const navigate = useNavigate();
  const [instructorName, setInstructorName] = useState("");
  const [stats, setStats] = useState({
    courses: 0,
    lectures: 0,
    courseList: [],
    lectureList: [],
  });
  const [loading, setLoading] = useState(true);

  // Fetch instructor info from localStorage
  useEffect(() => {
    const storedInstructor = JSON.parse(localStorage.getItem("instructorData"));
    if (storedInstructor) setInstructorName(storedInstructor.name);
  }, []);

  // Fetch dashboard stats
  useEffect(() => {
    const fetchDashboard = async () => {
      try {
        const token = localStorage.getItem("instructorToken");
        const res = await axios.get(
          "http://localhost:5000/api/instructor/dashboard",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );
        setStats(res.data);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setLoading(false);
      }
    };

    fetchDashboard();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("instructorToken");
    localStorage.removeItem("instructorData");
    navigate("/login"); // RoleBasedLogin
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Navbar */}
      <nav className="bg-blue-600 text-white px-6 py-4 flex justify-between items-center">
        <h1 className="font-bold text-xl">Instructor Dashboard</h1>
        <div className="flex items-center gap-4">
          <span>Welcome, {instructorName}</span>
          <button
            onClick={handleLogout}
            className="bg-white text-blue-600 px-3 py-1 rounded hover:bg-gray-200 transition"
          >
            Logout
          </button>
        </div>
      </nav>

      {/* Stats */}
      <div className="p-6">
        <h2 className="text-2xl font-semibold mb-4">Statistics</h2>
        {loading ? (
          <p>Loading stats...</p>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
            <div className="bg-white p-4 rounded shadow">
              <h3 className="text-lg font-medium">Lectures</h3>
              <p className="text-2xl font-bold">{stats.lectures}</p>
            </div>
            <div className="bg-white p-4 rounded shadow">
              <h3 className="text-lg font-medium">Courses</h3>
              <p className="text-2xl font-bold">{stats.courses}</p>
            </div>
          </div>
        )}

        {/* Course List */}
        <div className="mb-6">
          <h3 className="text-xl font-semibold mb-2">Assigned Courses</h3>
          {stats.courseList.length === 0 ? (
            <p>No courses assigned.</p>
          ) : (
            <ul className="list-disc pl-6">
              {stats.courseList.map((course) => (
                <li key={course._id}>{course.name}</li>
              ))}
            </ul>
          )}
        </div>

        {/* Lecture List */}
        <div>
          <h3 className="text-xl font-semibold mb-2">Assigned Lectures</h3>
          {stats.lectureList.length === 0 ? (
            <p>No lectures assigned.</p>
          ) : (
            <ul className="list-disc pl-6">
              {stats.lectureList.map((lec) => (
                <li key={lec._id}>
                  {lec.title} ({lec.courseId?.name || "No Course"})
                </li>
              ))}
            </ul>
          )}
        </div>
      </div>
    </div>
  );
};

export default InstructorDashboard;
